import React, {Component} from 'react';
import {Navbar, Nav} from 'react-bootstrap'
import './basic-navbar.css'

class BasicNavbar extends Component{
    render(){
        return(
            <Navbar className="navbar">
            <Navbar.Brand className="brand" href="/">React-Bootstrap</Navbar.Brand>
            <Nav className="justify-content-end">
                <Nav.Item>
                    <Nav.Link href="/register" style={{color:"blue"}}>Register</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link href="/login">Login</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link href="/equipment">Equipment</Nav.Link>
                </Nav.Item>
            </Nav>
            </Navbar>
            // <Navbar className="navbar">
            //     <Navbar.Brand className="brand" href="/">React-Bootstrap</Navbar.Brand>
            //     <Nav className="justify-content-end">
            //         <Nav.Item>
            //             <Nav.Link href="/register">Register</Nav.Link>
            //         </Nav.Item>
            //         <Nav.Item>
            //             <Nav.Link href="/login">Login</Nav.Link>
            //         </Nav.Item>
            //         <Nav.Item>
            //             <Nav.Link href="/equipment">Equipment</Nav.Link>
            //         </Nav.Item>
            //     </Nav>
            // </Navbar>
        );
    }
}

export default BasicNavbar;
